import React, { useState } from 'react';
import './RoUte.css';
import A from './A';
import B from './B';
import Dd from './Dd';
import {Switch,Route}from 'react-router-dom';

const RoUte = () =>{

    const [data,setdata] = useState('with URL');

    const a =()=>{
        setdata('localhost:3000/a');
    }
    const b =()=>{
        setdata('localhost:3000/b');
    }
    const defaulti =()=>{
        setdata('localhost:3000');
    }
    return(
        <>
            <div className="RoUte">
            <h1>Try :- {data}</h1>
            <div className="btn">
                <button onClick={defaulti}>0</button>
                <button onClick={a}>A</button>
                <button onClick={b}>B</button>
            </div>
            <Switch>
                <Route component={Dd}/>
                <Route exact path='/a' component={A}/>
                <Route exact path='/b' component={B}/>
            </Switch>
            </div>
        </>
    );
};
export default RoUte;
